import React from 'react'

const Footer = () => {
  return (
    <section id ="footer" className="bg-white md:px-28 ">
    <div className="container flex flex-col items-center justify-between px-6 py-24 mx-auto space-y-12 md:py md:flex-row md:space-y-0">
      <h2 className='md:text-4xl font-bold leading-tight text-center text-2xl text-whitemd:mx-w-xl md:text-left'>
        Need to Know More Information 
      </h2>
    </div>
  </section>
  )
}

export default Footer
